import classes from "./MealForm.module.css"
import Input from "../../UI/Input";

function MealForm(props){
    return(
        <form className={classes.form}>
            <button>+ Add</button>
            <Input 
            label="Amount"
            Input={{
                id:'amount__'  + props.id,
                type:"number",
                max:5,
                min:1,
                step:1,
                defaultValue,
            }}
            />
        </form>
    )
}

export default MealForm;
